import React from 'react';

function Contact() {
  return (
    <div className="contact-container">
      <h4 className="email">support@experienceconerts.com</h4>
      <h3 className="footer-name">EXP|CON</h3>
      <p className="copyright">2019 copyright All Rights Reserved | Speer Technologies Incorporated</p>
    </div>
  );
}

export default Contact;
